            },
        {
        id: 2,
        name: "Golden State Warriors",
        precio: 134,
        imgurl: "https://picsum.photos/200/300",
        descripcion: "Detalles Del Producto: Jersey de equipo NBA Golden State Warriors a単o 2020 del Campeonato Copa Del Rey",
        stock: 7,
        },
    ];
    
    return ( 
    <div className="mai">
        <div className="">
            <div className="">
                <img src={imgurl} alt="imagen"></img>
                <div className="">
                    <h2>{name}</h2>
                    <p>{descripcion}</p>
                    <h3>U$D {precio}</h3>
                    <h6>Stock: {stock}</h6>
                    <Button type="alert" text="Comprar"/>
                    <hr/>
                </div>
            </div>
        </div>
    </div>
    );
}

